b'My youngest daughter, Esther, turns 8 on Thursday, in isolation. She loves #puppies and #Frozen2. Any possible way to make her day special with a greeting from Anna, Elsa or Olaf? 
@KristenBell @joshgad @idinamenzel

Also, please send her many puppies! RT for reach :)'

